def longestPrefix(str):
    l = []
    r = []
    str1=""
    for i in range(len(str)-1):
        str1 += str[i]
        l.append(str1)
    str2 = ""
    for i in range(len(str)-1,0,-1):
        str2 = str[i] +str2
        r.append(str2)
    res=[]
    for i in range(len(l)):
        for j in range(len(r)):
            if l[i] == r[j]:
                res.append(l[i])
    lenres = ""
    for i in res:
        if len(i)>len(lenres):
            lenres = i
    return lenres

print(longestPrefix(""))